import instagram1 from '../assets/instagram1.png'

const Navbar = () => {
    return (
        <nav>
            <button className="logo">
                <img src={instagram1} alt="logo" />
            </button>
            <input type="text" className='search' placeholder />
        </nav>
    )
}

export default Navbar;
